export function rldToPrintSymbols(rld) {
  let newrld = [];

  if (Array.isArray(rld)) {
    rld.forEach((it) => {
      let newt = it === "Z" ? "j" : !!KAOQIN[it] ? KAOQIN[it].printSym : it;

      newrld.push(newt);
    });

    console.log("Old rld: ", rld);
    console.log("New rld: ", newrld);
  } else {
    console.log("Roulemed data is not an array!\n", rld);
    return rld;
  }

  return newrld;
}

export function getFrenchDayName(year, month, day, fullName) {
  const date = new Date(year, month - 1, day); // Month is zero-based in JavaScript
  const dayIdx = date.getDay();
  const daysInFrench = [
    "Dimanche",
    "Lundi",
    "Mardi",
    "Mercredi",
    "Jeudi",
    "Vendredi",
    "Samedi",
  ];

  const dayName = daysInFrench[dayIdx];

  if (fullName) return dayName;

  return dayName === "Mercredi"
    ? "W"
    : dayName === "Dimanche"
    ? "DIM"
    : dayName.charAt(0);
}
